import { useState } from "react";

export default function Form () {

    const [userData, setUserData] = useState({
        email: "",
        password: "",
    })

    return (
        <form>
            <label>Mail</label>
            <input
            value={userData.email}/>
            <label>Password</label>
            <input
            value={userData.password}/>
            <button>Submit</button>
        </form>
    )
}
